import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Footer.css';

const Footer = () => {
  const navigate = useNavigate();

  const handleRestart = () => {
    navigate('/');
  };

  return (
    <div className="footer">
      <div className='d-flex justify-content-center mt-3'>
        <button className='btn btn-light rounded-pill px-5 py-3' onClick={handleRestart}>Start Again <i class="bi bi-arrow-counterclockwise"></i></button>
      </div>
      <div className="need-help">
        <h3>NEED HELP?</h3>
        <p>Can't find your current model? <button className="link-button">Contact us</button></p>
      </div>
    </div>
  );
};

export default Footer;
